import TodoList from "./TodoList";

const SearchBar = () => {
  return (
    <div className='searchbar'>
      <input type='text' placeholder='Search' />
      {taskList.map((val, key) => {
        return <div>{val.name} </div>;
      })}
    </div>
  );
};

export default SearchBar;
